/**
 * 
 */
import "../../styles/Components/Public.css"
import Card from "./Card"
import 'swiper/css';
import 'swiper/css/navigation';
import 'swiper/css/pagination';
import { Swiper, SwiperSlide } from "swiper/react"
import { Pagination, Navigation, Virtual, Autoplay } from "swiper"

function slideMove(direction) {
    if( direction === "prev" ) document.querySelector(".swiper-button-prev").click()
    else if( direction === "next" ) document.querySelector(".swiper-button-next").click()
}

function SectionTop() {
    return (
        <div className="section-top">
            <h3>New Uploads</h3>
            <div className="swiper-navigation">
                <button onClick={() => {slideMove("prev")}}><ion-icon name="chevron-back"></ion-icon></button>
                <button onClick={() => {slideMove("next")}}><ion-icon name="chevron-forward"></ion-icon></button>
            </div>
        </div>
    )
}

function CarouselSection() {
    return (
        <Swiper
            className="carousel"
            modules={[Navigation, Pagination, Virtual, Autoplay]}
            spaceBetween={50}
            slidesPerView={1}
            loop={true}
            autoplay={{ delay: 2000, disableOnInteraction: false }}
            navigation={{ clickable: true }}
            pagination={{ clickable: true }}
        >
            {slidesData.map((slide, index) => (
                <SwiperSlide key={slide.owner} virtualIndex={index}>
                    <Slide key={slide.owner} data={slide}/>
                </SwiperSlide>
            ))}
        </Swiper>
    )
}

export default function Public() {
    return (
        <div className="public-section">
            <SectionTop />
            <CarouselSection />
            <Card period="03:51" picture="./media/instant.jpg" title="Minimal Photography" owner="Instant" views="4.7k" time="2 hours" />
        </div>
    )
}
